import styled from "styled-components";

const OmOss = () => {
    return (
        <Wrapper>
            <div className="container">
                <h1>Om Oss</h1>

            </div>
        </Wrapper>

    );
};

export default OmOss;

const Wrapper = styled.div`
  width: 100vw;
  height: 90vh;
  position: absolute;
  top: 10%;

  .container {
    background-color: red;
    height: 90%;
  }
`;
